import React, { useState } from 'react';
import { LocationFrame} from './locationFrame';
import weatherLogo from '../resources/WeatherIcons/logo.png';
import '../App.css';

export function Forecaster(props) {

    const locations = props.locations;

    return (
        <div>
            <img src={weatherLogo} alt="logo" className='App-logo' />
            <br/>
            <h1 className='App-title'>Forecaster</h1>
            {locations.map((location) => (
                <LocationFrame locations={locations} key={location.id} name={location.name} weather={location.weather} temp={location.temp} />
             ))}
        </div>
    )
}
